import React, {useState} from 'react'
import Member from './Member'

function Crew(props){
    function addMembers(){
        console.log("adding Members")
        props.selected.forEach(element => {
            updateCrewMembers((prevState) => [...prevState, element])
        });
        
    }
    return(
        <div onClick={addMembers} className="crew">
            <p>{props.id}</p>
        </div>
    )
}
export default Crew
